import { Route, Routes } from 'react-router-dom';
import PrivateRoutes from './components/PrivateRoute';
import Dashboard from './containers/Dashboard';
import Login from './pages/Login';
import { DashboardHome } from './containers/Dashboard/Dashboard.component';
import { Pilots } from './pages/Pilots';
import { PilotDetails } from './pages/PilotDetails';
import { PaymentMonthly } from './components/PaymentMonthly';
import { StatusList } from './pages/StatusList';
// import { UpdatePilotStatus } from './components/UpdatePilotsStatus';
import { UpdatePilotStatus } from './compo';

function App() {
  return (
    <Routes>
      <Route element={<PrivateRoutes />}>
        <Route element={<Dashboard />} path="/">
          <Route index element={<DashboardHome />} />
          <Route path="pilots" element={<Pilots />} />
          <Route path="/pilots/:userId" element={<PilotDetails />} />
          <Route
            path="/pilots/:userId/status"
            element={<UpdatePilotStatus />}
          />
          <Route path="/pilots/status-list" element={<StatusList />} />
          <Route path="/paymentMonthly" element={<PaymentMonthly />} />
          <Route path="/paymentMonthly/:userId" element={<PaymentMonthly />} />
          <Route path="*" element={<DashboardHome />} />
        </Route>
      </Route>
      <Route path="/login" element={<Login />} />
      <Route path="*" element={<Login />} />
    </Routes>
  );
}

export default App;
